  const cells = [null, null, null, "x", "x", "x", null, null, null];
  console.log(caculateWinner(cells));
  return (
    <div className="game-board">
      {Array(9)
        .fill()
        .map((item, index) => (
          <Cell></Cell>
        ))}
    </div>
  );
};

export default Board;
